import { useSelector, useDispatch } from 'react-redux'

//UI UTIL
import { MultilineTextFields } from "../cmps/Select.jsx";
import TextField from "@material-ui/core/TextField";


export function Home() {
  const initialUserMedia = {
    mediaType: "instoosh ",
    mediaLink: "https://www.instagram.com/danasandman/",
  };

  const [userMedia, setUserMedia] = useState(initialUserMedia);

  useEffect(() => {
      console.log('user madia changed',userMedia);
    dispatch(setMediaType(userMedia))
}, [userMedia]) 



  //   const [textValue, setTextValue] = useState('');
  //   const onTextChange = (ev) => setTextValue(ev.target.value);
  useEffect(() => {
    console.log("userMedia", userMedia);
    console.log("userMedia.mediaLink", userMedia.mediaLink);
  }, []);

  const handleChange = ({ target }) => {
    const value = target.value;
    //   setUserMedia({...userMedia, mediaLink: value });
    setUserMedia((prevUserMedia) => ({ ...prevUserMedia, mediaLink: value }));
    console.log("userMedia", userMedia);
    console.log("userMedia.mediaLink", userMedia.mediaLink);
  };

  return (
    <Fragment>
      <title> Home page</title>
      <h2>?אז מה תרצו שהטאפ טאץ׳ שלכם יעשה</h2>
      <MultilineTextFields />
      <TextField
        label="הזינו כאן לינק לפרופיל האינסטגרם שלכם"
        variant="outlined"
        name="userLink"
        // value={email}
        onChange={handleChange}
        required
      />
      <h2> !עלות התג 49 ש״ח בלבד כולל משלוח</h2>
      <button> - הזמינו עכשיו</button>

      <span>{userMedia.mediaType}</span>
      {/* <NameApp></NameApp> */}
    </Fragment>
  );
}
